        {"quote_author":"Bayerisch","quote_contents":"an apple a day keeps anyone away if you throw it hard enough"},
        {"quote_author":"mark3748","quote_contents":"bhyve is fine"},
        {"quote_author":"Cajaks2","quote_contents":"Docker is the lord and savior and answer to all questions, how dare you question it"},
        {"quote_author":"LaffyFx","quote_contents":"Google runs on scratch with a code.org kernel"},
        {"quote_author":"Danby","quote_contents":"Have you considered using a proper NIC from Realtek?\r"},
        {"quote_author":"Okami","quote_contents":"I am not a Cis Admin"},{"quote_author":"chef","quote_contents":"i mean dying from a virus in gold coast is user error"},
        {"quote_author":"Bill Gates","quote_contents":"Measuring programming progress by lines of code is like measuring aircraft building progress by weight"},
        {"quote_author":"Eric","quote_contents":"not sure if you can trust open sores software"},
        {"quote_author":"Zandikar","quote_contents":"open port 22 to the internet\" \"But my router only has 5 ports!"},
        {"quote_author":"Unknown","quote_contents":"Wow they sell tech support as a smart plug now?"}
       ]
    }

      getQuotes() {
        let RandomQuote = quotes[Math.floor(Math.random() * quotes.length)];
        return quotes.map((quote) => {
        if (true){
            return (

                <div>
                <h4 className='frontpage'>
                    <h3>Random quote of the day</h3>
                  {RandomQuote.quote_author} - "{RandomQuote.quote_contents}" 
                
                        
                 </h4>
                  </div>
              ); 
        }

        });
      }


    render(){
    return (
 
        <div className="page"><section>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
        <br></br>
	<div id = "heading">
        <h1>Home</h1><h1 class = "blinking">_</h1>   
        </div> 
        <hr class = "greenbar"></hr>
        <h1>{this.getQuotes()}</h1>
        <hr class = "greenbar"></hr>
        <p>My name is Jacob Della, welcome to my site! I am currently a student enrolled at Towson University, enrolled in their Computer Science program. and minoring in Math. My graduation date should be by sometime in 2021. 
          I have numerous years of IT and Software experience doing projects at home and work. I generally tend to focus my efforts on more open technology stacks such as; Python, JavaScript, C++, and Java.If you were 
          around for the original version of this website it used Django, it has now been rewritten to utilize React, Express API and a MySQL docker image. This website is hosted at my house in a Ubuntu VM using Docker images.
          All the important stuff is under links.</p>
          <hr class = "greenbar"></hr>
          <h1>Tweets by yours truly.</h1>
          <a>
          <TwitterTimelineEmbed
          id = "twitter-widget"
          sourceType="profile"
          screenName="JDella1996"
          options={{height: 800, width:700}}
          />
          </a>
        <p>By JDella1996</p>
        <p>Hosted on GRAVEYARD going 2 years strong.</p>
        <p>Last Updated 02/2020</p>
        </section>
       </div>
        );
    }

}
 
export default Home;
